import styled, { css } from "styled-components"

const primaryColor = css`
    color:#448487
`
const Homepage = styled.div`
    margin:0 auto;
    ${primaryColor};
    .cover{
        margin:30px auto;
        display:block;
        background-size:cover;
        background-repeat:no-repeat;
        width: 100%;
        height:700px
    }
`
export default Homepage
